    false,nt"url": null,nt"notes": "This annual narrative report for Innoko
    NWR outlines Refuge accomplishments during the 1986 calendar year. The report begins
    with a summary of the year's highlights and weather conditions. The report includes
    a planning section which discusses the master plan and compliance with environmental
    and cultural resource mandates. Refuge administration is outlined; information about
    personnel, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands and fire management. The wildlife section
    of the report discusses waterfowl, raptors, game mammals, fisheries resources, and
    marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms and hunting. The equipment and facilities section of
    the report provides information about new construction, equipment replacement, communication
    systems, and computer systems. Cooperative programs are provided at the end.",nt"owner_org":
